prompt --application/deployment/install/install_create_schema
begin
wwv_flow_imp_shared.create_install_script(
 p_id=>wwv_flow_imp.id(103305696659177452)
,p_install_id=>wwv_flow_imp.id(103305237943174444)
,p_name=>'Create Schema'
,p_sequence=>10
,p_script_type=>'INSTALL'
,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'CREATE TABLE book_collections_dv_root(',
'   "_id"            varchar2(64)  DEFAULT ON NULL SYS_GUID(),',
'   created          timestamp,',
'   collection_name  varchar2(64),',
'   PRIMARY KEY("_id")',
')',
'/',
'    ',
'CREATE TABLE book_collections_dv_books(',
'   "_id" varchar2(64) default on null sys_guid(),    ',
'   isbn                   varchar2(64),',
'   price                  number,',
'   title                  varchar2(64),',
'   published              timestamp,',
'   publisher              varchar2(64),',
'   "_id_book_collection"  varchar2(64),',
'   PRIMARY KEY("_id")',
')',
'/',
'',
'CREATE TABLE book_collections_dv_authors(',
'   "_id" varchar2(64) default on null sys_guid(),',
'   last_name  varchar2(64),',
'   first_name  varchar2(64),',
'   "_id_book"  varchar2(64),',
'   PRIMARY KEY("_id")',
')',
'/',
'',
'ALTER TABLE book_collections_dv_books',
'ADD CONSTRAINT fk_book_collections_dv_books_to_book_collections_dv_root',
'FOREIGN KEY ("_id_book_collection")',
'REFERENCES book_collections_dv_root("_id")',
'/',
'        ',
'ALTER TABLE book_collections_dv_authors',
'ADD CONSTRAINT fk_book_collections_dv_authors_to_book_collections_dv_books',
'FOREIGN KEY ("_id_book") ',
'REFERENCES book_collections_dv_books("_id")',
'/',
'',
'CREATE INDEX IF NOT EXISTS fk_book_collections_dv_books_to_book_collections_dv_root_index ON book_collections_dv_books("_id_book_collection")',
'/',
'',
'CREATE INDEX IF NOT EXISTS fk_book_collections_dv_authors_to_book_collections_dv_books_index ON book_collections_dv_authors("_id_book")',
'/',
'',
'CREATE OR REPLACE JSON RELATIONAL DUALITY VIEW BOOK_COLLECTIONS_DV AS ',
'book_collections_dv_root @insert @update @delete',
'{ ',
'  "_id"',
'  collectionName: collection_name',
'  created',
'  books: book_collections_dv_books @insert @update @delete',
'  { ',
'    "_id"',
'    ISBN: isbn',
'    price',
'    title',
'    published',
'    publisher',
'    authors: book_collections_dv_authors @insert @update @delete',
'    {',
'      "_id"',
'      lastName: last_name',
'      firstName: first_name',
'    } ',
'  } ',
'}',
'/',
''))
);
end;
